window.bookSummaryJSON = "<p>Europe is erupting in tension and violence. </p> <p>David is only adding to the conflagration by setting a trap, one our team will trip to save those people still alive. </p> <p>There is one thing every enemy of Bethany Anne finds out: They will be ground under her heels. Now, something is heating up between Bethany Anne and Michael, and it isn’t her anger over him leaving her behind. Well, much. Further, the Patriarch is learning there might be someone worth sticking around for in his future. If she would just stop being so hard-headed. </p> <p>David believes he is smarter than the rest. Now, he must fight both the Patriarch and the Queen Bitch. Are his days numbered? </p> <p>Performed by Colleen Delany, Emily Beresford, James Konicek, Terence Aselford, Michael John Casey, Steve Wannall, Bianca Bryan, Christopher Graybill, Rob McFadyen, Eva Wilhelm, Eric Messner, Bradley Foster Smith, Matthew Schleigh, Matthew Pauli, James Lewis, Nora Achrati, Matthew Bassett, Danny Gavigan, Joel David Santner, Anthony Palmini, Alejandro Ruiz, Jacob Yeh, Yasmin Tuazon, Holly Adams, Ken Jackson, Robb Moreira, Zeke Alton, Jonathan Lee Taylor, Darius Johnson, Henry W. Kramer, Chris Stinson, Jason Keller, Tyler Hyrchuk, Mort Shelby, and Rose Elizabeth Supan.</p>"; 
